import { BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import Home from "./Home";
import Registration from "./Registration";
import Login from "./Login";
import "./App.css";

const App = () => {
  return (
    <>
      <Router>
        <div className="header">
        <span className="head"> Hostel Management System</span>
          <span className="Link2" ><Link to="/home" style={{ textDecoration: 'none' }}>Home</Link></span>

          <span className="Link1"><Link to="/" style={{ textDecoration: 'none' }}>Registration</Link></span>
          <span className="Link1"> <Link to="/login" style={{ textDecoration: 'none' }}>Login</Link></span>

        </div>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/register">
            <Registration />
          </Route>
          <Route path="/login">
            <Login />
          </Route>

          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </>
  );
}

export default App;
